import React from 'react';
import logo from './logo.svg';
import './App.css';
import { BrowserRouter, Routes, Route } from 'react-router-dom';

function Header() {
  return (
    <div className="bg-lime-400 h-11 flex items-center p-4">
      <h1 className="text-slate-900 font-extrabold text-l lg:text-xl">Workify</h1>
    </div>
  );
}

function HomePage() {
  return (
    <div>
      <h1 
        className="text-slate-900 font-extrabold text-2xl lg:text3xl tracking-tight text-center dark:text-white">
        Looking for job, education advice or career interested?
      </h1>
      <p 
        className="mt-2 text-slate-600 text-center mx-auto dark:text-slate-400">
        You came to the right place!
      </p>
      <div className="mt-6 flex items-center place-content-center">
        <input 
          alt="Search where to start"
          className="lg:w-96 w-72 border border-2 border-lime-400 border-dashed p-2 rounded-lg focus-visible:border-lime-500 focus-visible:outline-0 empty:text-center" 
          placeholder="Where do i start?" />
          <button className="p-2 text-center items-center inline-flex border-slate-100">
            <span className="mx-auto mt-auto material-symbols-outlined">search</span>
          </button>
      </div>
    </div>
  );
}

function App() {
  return (
    <div className="App">
      <Header></Header>

      <div className="p-4 max-w-7xl">        
        <BrowserRouter>
          <Routes>
            <Route path="/" element={<HomePage/>}></Route>
          </Routes>
        </BrowserRouter>
      </div>
    </div>
  );
}

export default App;
